// Routes.js
import React from 'react';

import { BrowserRouter, Router, Route, Routes as Switch } from 'react-router-dom';
import WordSearch from './Views/WordSearch';
import Home from './Views/Home';


function Routes() {
    return (

        <Router>
            <Route path="/wordsearch" component={WordSearch} />
            <Route path="/home" component={Home} />
        </Router>
    );
}

export default Routes;
